                  "&.Mui-focused .MuiOutlinedInput-notchedOutline": {
                    borderColor: "#888888", 
                  },
                  "&:hover .MuiOutlinedInput-notchedOutline": {
                    borderColor: "#888888", 
                  },
                  "& .MuiOutlinedInput-notchedOutline": {
                    borderColor: "#888888", 
                  }
                }
              }}{...params} placeholder="Booth name"/>);
                }}
              />
          </Box>
        </Grid>
        <Grid item>
          <TextField
            size="small"
            placeholder="Search by entering a name"
            variant="outlined"
            autoComplete="off"
            value={searchName}
            onChange={(e) => setSearchName(e.target.value)}
            InputProps={{
              endAdornment: <Icon icon="material-symbols-light:search" width="25" height="25" style={{ color: 'black' }} />,
            }}
            sx={{
              "& .MuiOutlinedInput-root": {
                "&.Mui-focused .MuiOutlinedInput-notchedOutline": {
                  borderColor: "#3e4241",
                },
                "&:hover .MuiOutlinedInput-notchedOutline": {
                  borderColor: "#3e4241",
                },
                "& .MuiOutlinedInput-notchedOutline": { borderColor: "#3e4241", }
              },
              mr: 2
            }}
          />

          <Button
            variant="contained"
            onClick={handleSearch}
            sx={{
              backgroundColor: '#EE8832',
              color: 'white',
              fontWeight: 'bold',
              '&:hover': {
                backgroundColor: '#EE8832',
                color: 'white',
              },
            }}
          >
            Search
          </Button>
        </Grid>
      </Grid>

      {selectedBoothInAutocomplete && (
        <NotCastedDataComponent boothName={selectedBoothInAutocomplete} />
